import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Link } from 'react-router-dom/cjs/react-router-dom';

function App() {
  return (
    <div className="App">
      <div>
          <Link to="/">Home</Link>
          <Link to="/contato">Contato</Link>
      </div>

    </div>
  );
}

export default App;
